Let's think step by step. The volume of a cylinder is given by the formula $V=h\pi r^2$, where $h$ is the height and $r$ is the radius. Here, both the base area ($\pi r^2$) and the height ($h$) increase each hour; hence, the change in volume equals the cross sectional area times the rise in depth: \[
\begin{aligned} 20\pi&=(4)\pi r^2 \\ r^2&=5 &(\text{Divide through by }\pi )\\ r &= \sqrt{5}\end{aligned}
\]Therefore, when simplified as much as possible, the value of unknown variable x is $\sqrt{5}$. The answer is: \sqrt{5}.

